import React, { useState } from 'react';
import axios from 'axios';

function AgregarViaje() {
  const [viaje, setViaje] = useState({
    pais: '',
    duracion: '',
    costos: '',
    km_recorridos: '',
    mes: '',
    anio: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setViaje({ ...viaje, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:3001/api/viajes', viaje);
      alert('Viaje agregado correctamente.');
    } catch (err) {
      alert('Error al agregar el viaje.');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>Pais:</label>
      <input name="pais" value={viaje.pais} onChange={handleChange} />
      <label>Duración (días):</label>
      <input name="duracion" value={viaje.duracion} onChange={handleChange} />
      <label>Costos:</label>
      <input name="costos" value={viaje.costos} onChange={handleChange} />
      <label>Km Recorridos:</label>
      <input name="km_recorridos" value={viaje.km_recorridos} onChange={handleChange} />
      <label>Mes:</label>
      <input name="mes" value={viaje.mes} onChange={handleChange} />
      <label>Año:</label>
      <input name="anio" value={viaje.anio} onChange={handleChange} />
      <button type="submit">Agregar Viaje</button>
    </form>
  );
}

export default AgregarViaje;
